<!DOCTYPE html>
<html lang="en">
  <head>
    <meta charset="UTF-8" />
    <meta name="viewport" content="width=device-width, initial-scale=1.0" />
    <meta http-equiv="X-UA-Compatible" content="ie=edge" />
    <title>Jesus Ramirez | Portfolio</title>
  <meta name="theme-color" content="#b1a" /><link rel="manifest" href="manifest.3bb280bf2025b2145cd94907da596102.json" /><link rel="shortcut icon" href="favicon.png"></head>

  <body>
    <div id="app"></div>
    <noscript> <h3>Esta pagina necesita de Javascript para funcionar</h3> </noscript>
    <script>
      if ("serviceWorker" in navigator) {
        window.addEventListener("load", function() {
          navigator.serviceWorker
            .register("/service-worker.js")
            .then(registration => {
              console.log("%c Registrado", "color:white;background-color:blue;", "Registrado!");
            })
            .catch(registrationError => {
              console.log("%c Error", "color:white;background-color:red;", registrationError);
            });
        });
      }
    </script>
  <script type="text/javascript" src="js/app.5994f94e476e7697f3da.bundle.js"></script></body>
</html>
